import { useEffect } from 'react';
import TaskPanel from './TaskPanel';
import Countdown from './Countdown';

const TimePanel = props => {
    useEffect(() => {
        console.log(props);
    }, [])
    return (
        <>
            <section className="time-panel">
                <h2 className="type-title">Work</h2>
                <Countdown />
            </section>
            <TaskPanel userTasks={props.userTasks}/>
            <style jsx>{`
                .time-panel {
                    padding: 20px;
                    grid-area: time;
                    background-color: #DA523E;
                    border-radius: 10px;
                }
                .time-panel .type-title {
                    color: #2D2D2D;
                    font-weight: 500;
                    text-align: center;
                }
                .task-panel {
                    background-color: white;
                    grid-area: tasks;
                    border-radius: 10px;
                    padding: 20px;
                }
                .task-panel h2 {
                    color: #2D2D2D;
                    font-size: 1rem;
                }
            `}</style>
        </>
    )
}

export default TimePanel;
